import { Route } from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";
import NewQuote from "./pages/NewQuotes";
import QuoteDetail from "./pages/QuoteDetail";

function App() {
  return (
    <div>
      <Route path="/all-quotes">
        <AllQuotes />
      </Route>
      <Route path="/new-quotes">
        <NewQuote />
      </Route>
      <Route path="/all-quotes">
        <QuoteDetail />
      </Route>

    </div>
  );
}

export default App;
